import React, { useState } from "react";
import NavButton  from "./Buttons";


function HomePage(){
    const [homePageState,setHomeStae]={
        showPage:true
    }
    function clickHandleNextPage(){
        setHomeState({showPage:homePageState.showPage?false:null})

    }
    return(
        <div>

            <div>
                <NavButton 
                        text="1 vs 1"
                        onClick={null}
                />
            </div>

            <div>
                <NavButton 
                        text="1 vs Computer"
                        onClick={null}
                />
            </div>

            <div>
                <NavButton 
                text="Computer vs Computer"
                onClick={null}
                />
            </div>

            <div>
                <NavButton 
                    text="Simulation"
                    onClick={null}
                />
            </div>

        </div>
    )
}

export default HomePage;
